package aqqje.com.spel;public class Adress {    private String City;    private String street;    public Adress() {    }    public Adress(String city, String street) {        City = city;        this.street = street;    }    public String getCity() {        return City;    }    public void setCity(String city) {        City = city;    }    public String getStreet() {        return street;    }    public void setStreet(String street) {        this.street = street;    }    @Override    public String toString() {        return "Adress{" +                "City='" + City + '\'' +                ", street='" + street + '\'' +                '}';    }}